import React from "react";
import './index.css';



const Todolist = (props) =>{
    return (
        <>
        <div className='todo'>
        <i class='fa fa-minus'  area-hidden='true'/>

         <li>{props.text}</li>
        </div>
        </>
    )
};
export default Todolist;
